(58, 2, 'тестт', '', '2018-09-20', '18:57', 5, 1537365455, 1537365473, 19, NULL),
(60, 2, 'Очень нужно хорошего мастера который нам поможет все правильно сделать в нашей квартире чтобы в ней было всё замечательно и вовремя приходил и отвечал на запросы и Никиты Свенцицкого', '', '2018-10-31', '14:50', 1, 1540990275, 1540990275, 41, NULL),
(61, 1, 'Ребята нужен срочно хороший мастер который нам поможет разобраться со всеми проблемами в квартире и ещё оставить на себя хорошее впечатление и порадует нас чем-то прекрасным', '<p>дана команда</p><p>выполнено</p>', '2018-11-22', '14:56', 5, 1540990613, 1541671535, 44, NULL),
(62, 3, 'Очень хочу срочно вызвать мастера потому что дома нужно срочно трубы починить отремонтировать все и чтобы он обязательно ещё хорошо нас порадовал и оставил прекрасное настроение', '', '2018-10-31', '15:06', 1, 1540991229, 1540991229, 39, NULL),
(63, 3, 'Прошу очень срочно прислать мастера потому что нужно категорически быстро помощь по квартире', '', '2018-10-31', '15:09', 1, 1540991405, 1540991405, 11, NULL),
(64, 3, 'Ребята пожалуйста срочно приедьте нам квартиру отремонтирую тебе эти любимые наши батареи покрасьте хворать жевать свет чтобы они красивые были очень сильно', '', '2018-10-31', '15:23', 1, 1540992230, 1540992230, 7, NULL),
(65, 3, 'Там пришел прийти и отремонтировать ко мне сантехнику и все что нужно по моей карте', '', '2018-11-15', '15:39', 1, 1542116422, 1542116422, 11, NULL),
(66, 2, 'Пожалуйста срочно пришлите электрика нам нужно починить розетки вот ввожу информацию сюда да она просто голос распознает это айфоновская фишка такая', '', '2018-11-14', '12:51', 1, 1542192740, 1542192740, 11, NULL),
(67, 2, ' Is this patient but I will start Пожалуйста пришлите своего электрика потому что нужно проверить моей розетки', '', '2018-11-14', '15:49', 1, 1542203430, 1542203430, 7, NULL),
(68, 1, 'Течет кран', '', '2018-11-15', '15:12', 10, 1542287602, 1542289162, 19, NULL),
(69, 1, ' Здравствуйте мне очень срочно нужен мастер пожалуйста пришлите ', '', '2018-11-23', '12:15', 1, 1542792842, 1542792842, 40, NULL),
