INSERT INTO `website` (`id`, `param`, `content`) VALUES
(1, 'home_title', ''),
(2, 'home_description', '&lt;b&gt;&lt;/b&gt;&lt;h3&gt;О ЖИЛОМ КОМПЛЕКСЕ&lt;br&gt;&lt;/h3&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\nЖилой комплекс «NORD» расположен на берегу Черного моря в живописном районе Одессы. Оригинальная архитектура комплекса делает его уникальным объектом не только для Одессы, но и для всей Украины – дом прекрасно вписывается в архитектуру берега и открывает свои жильцам и гостям прекрасный вид на бескрайнее море. Ярким преимуществом жилого комплекса является его месторасположения – удобная транспортная развязка, социальная инфраструктура, парк и прекрасный морской воздух создают все условия для комфортного проживания.\r\n\r\n\r\n\r\n\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;/b&gt;&lt;/p&gt;'),
(3, 'contact_title', 'Разработчик системы &quot;Мой Дом 24&quot;'),
(4, 'contact_description', '&lt;p&gt;Разработчиком системы&amp;nbsp;&quot;Мой Дом 24&quot; является компания&lt;b&gt; AVADA-MEDIA &lt;/b&gt;- компания специализирующаяся на разработке web и мобильных приложений разного уровня сложности, но неизменно высокого качества&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;i&gt;&lt;/i&gt;&lt;i&gt;Официальный сайт компании -&amp;nbsp;&lt;/i&gt;&lt;/b&gt;&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;https://avada-media.ua/&quot;&gt;&lt;b&gt;&lt;i&gt;https://avada-media.ua/&lt;/i&gt;&lt;/b&gt;&lt;/a&gt;&lt;b&gt;&lt;/b&gt;&lt;/p&gt;'),
(16, 'contact_url_site', 'https://avada-media.ua/moydom24/'),
(17, 'home_is_show_apps', '1'),
(5, 'contact_fullname', 'AVADA-MEDIA'),
(6, 'contact_location', 'ул. Космонавтов, 32'),
(7, 'contact_address', 'Малиновский р-н, г. Одесса'),
(8, 'contact_phone', '+38 (097) 179-96-63'),
(9, 'contact_email', 'info@avada-media.com.ua'),
(10, 'contact_map_embed_code', '&lt;div class=&quot;map&quot;&gt;\r\n        &lt;iframe src=&quot;https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2749.8611266486014!2d30.713265815873395!3d46.43163207638925!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x40c633a651e3fd09%3A0x9331380952bbfd2c!2z0LLRg9C70LjRhtGPINCa0L7RgdC80L7QvdCw0LLRgtGW0LIsIDMyLCDQntC00LXRgdCwLCDQntC00LXRgdGM0LrQsCDQvtCx0LvQsNGB0YLRjCwgNjUwMDA!5e0!3m2!1suk!2sua!4v1524221669656&quot; width=&quot;100%&quot; height=&quot;800&quot; frameborder=&quot;0&quot; style=&quot;border:0&quot; allowfullscreen&gt;&lt;/iframe&gt;\r\n&lt;/div&gt;'),
(11, 'about_title', 'О управляющей компании'),
(12, 'about_description', '&lt;p&gt;\r\n\r\n&lt;/p&gt;&lt;p&gt;Компания-застройщик не только создала этот объект для своих покупателей, но и после окончания строительства взяла на себя все услуги по обеспечению удобного проживания своих жильцов. Для этого была организована управляющая компания «Морская симфония», которая осуществляет комплексное обслуживание коммунальной сферы жизнедеятельности своих клиентов.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;i&gt;Миссией управляющей компании является такая схема взаимодействия с жильцами дома, при которой услуги компании не отвлекают их от проживания и отдыха и создают максимально комфортную экосистему в доме. Незаметный сервис и максимально эффективная работа являются визитной карточкой компании.&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;В функции управляющей компании входят как содержание и управление хозяйством комплекса, так и охраняемой придомовой территории – уборка, техническое обслуживание лифтового хозяйства, системы электро и водоснабжения дома, котельной и пожарной систем, диспетчеризация, охрана, содержание придомовой территории и многое другое. В штате компании собраны только профессионалы своего дела, которые помогут жильцам в самых трудных и критических ситуациях решить их жилищно-коммунальные проблемы семь дней в неделю круглосуточно – электрики и сантехники, инженеры, монтеры и другие специалисты имеют многолетний опыт и высокий уровень квалификации. &lt;/p&gt;&lt;p&gt;Все это делает жилой комплекс&amp;nbsp; уникальным, комфортным и безопасным местом для проживания и отдыха всей семьи круглый год. Доверьте заботу о вашем доме и вашей квартире управляющей компании&amp;nbsp; и вы сможете круглый год наслаждаться проживанием на берегу моря и прекрасной природой Одессы.&lt;/p&gt;\r\n\r\n&lt;br&gt;&lt;p&gt;&lt;/p&gt;'),
(13, 'about_image', '/upload/Website/about_image.png'),
(14, 'about_title_2', 'Дополнительные услуги'),
(15, 'about_description_2', '&lt;p&gt;\r\n\r\n&lt;/p&gt;&lt;p&gt;Главной обязанностью управляющей компании является поддержка комфортных условий для жильцов, оперативное реагирование на их просьбы и пожелания&lt;/p&gt;&lt;p&gt;&lt;b&gt;К дополнительным услугам управляющей компании также относятся: 24-часовая охрана придомовой территории и паркинга, уборка территории и вывоз мусора, обслуживание пирса и пляжа. Также при желании жильцы дома могут заказать любые строительно-ремонтные работы от штатной бригады компании&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;br&gt;&lt;p&gt;&lt;/p&gt;'),
(18, 'home_meta_title', 'Сайт Управляющей Компании ЖКХ - &quot;МОЙ ДОМ 24&quot;'),
(24, 'service_meta_title', 'СRM система для ОСМД - &quot;МОЙ ДОМ 24&quot;'),
(28, 'contact_meta_description', 'Украина, г. Одесса, Космонавтов, 32   Телефон, Viber: +38 097 179-96-63  Telegram: SergeyMeleshkevych  Skype: SergeyMeleshkevych\r\n'),
(19, 'home_meta_description', 'Универсальная система для управляющей компании ЖКХ многоквартирного дома &quot;МОЙ ДОМ 24&quot; - сайт управляющей компании + база управления квартирами + мобильное приложение - гибкая индивидуальная настройка для любой организации. Удобная комьютерная программа для ОСМД\r\n'),
(25, 'service_meta_description', 'Все возможности системы для ОСМД или управляющей компании ЖКХ: учет квартир, жильцов, показаний счетчиков, выставление счетов. Мобильные приложения для оплаты коммунальных услуг для жильцов многоквартиных домов.'),
(23, 'about_meta_keywords', 'Система Мой Дом 24,  сайт управляющей компании,  панель администратора,  персональные кабинеты жильцов дома,  мобильное приложение для IPhone,  мобильное приложение для Android, црм для ОСМД, управление квартирами для ОСМД, система управляющей компании жкх\r\n'),
(20, 'home_meta_keywords', 'программа для ОСМД, управление домом, управление многоквартирным домом, система учета квартир, программа для жильцов дома,  сайт управляющей компании, мой дом 21, crm для жильцов'),
(21, 'about_meta_title', 'CRM-система для управляющей компании ЖКХ - &quot;МОЙ ДОМ 24&quot;'),
(22, 'about_meta_description', 'Система учета услуг и расходов для жильцов многоквартирных домов - crm для  упавляющей компании ЖКХ и ОСМД. Система &quot;Мой Дом 24&quot; состоит из ПЯТИ компонентов:  сайт управляющей компании,  панель администратора,  персональные кабинеты жильцов дома,  мобильное приложение для IPhone и  Android'),
(26, 'service_meta_keywords', 'црм для осмд, мобильное приложение для оплаты коммунальных услуг, срм для управляющей компании жкх '),
(27, 'contact_meta_title', 'Система &quot;МОЙ ДОМ 24&quot; - Контакты'),
(29, 'contact_meta_keywords', 'Система, МОЙ ДОМ 24, Контакты'),
