INSERT INTO `website_home_feature` (`id`, `image`, `title`, `description`, `sort`) VALUES
(1, '/upload/WebsiteHomeFeature/1/image.jpeg', 'Магазины, Банки, Школы', '&lt;p&gt;\r\n\r\nРайон расположения жилого комплекса&amp;nbsp; имеет всю необходимую для проживания социальную инфраструктуру – в непосредственной близости находятся лечебно-профилактические учреждения, аптеки, магазины,  отделения банков, частные и коммерческие детские сады, школы\r\n\r\n&lt;br&gt;&lt;/p&gt;', 0),
(2, '/upload/WebsiteHomeFeature/2/image.jpeg', 'Рестораны и Кафе', '&lt;p&gt;\r\n\r\nВ непосредственной близости от жилого комплекса&amp;nbsp; расположены рыбный ресторан&amp;nbsp; и итальянская пиццерия. Кроме того, всего в десяти минутах ходьбы от комплекса находятся  рестораны испанской, итальянской, американской, украинской и русской кухни, пиццерии, кафе и лаунж-бары на любой вкус.\r\n\r\n&lt;br&gt;&lt;/p&gt;', 0),
(3, '/upload/WebsiteHomeFeature/3/image.jpeg', 'Пляж', '&lt;p&gt;\r\n\r\nЖилой комплекс расположен на берегу Черного моря в районе Аркадия. В десяти минутах ходьбы от него находится знаменитые пляжи Аркадия и Чайка, а чуть дальше – пляжи курортный, 13-ая станция Большого Фонтана, Пляжник и другие знаменитые пляжи Одессы\r\n\r\n&lt;br&gt;&lt;/p&gt;', 0),
(4, '/upload/WebsiteHomeFeature/4/image.jpeg', 'Спортивный Комплекс', '&lt;p&gt;\r\n\r\nВсего в 5 минутах ходьбы от жилого комплекса&amp;nbsp; находится Спортивный комплекс Международного гуманитарного университета - это современный оборудованный комплекс с залами для проведения волейбольных соревнований, соревнований по танцам и борьбе и других спортивных мероприятий \r\n\r\n &lt;br&gt;&lt;/p&gt;', 0),
(5, '/upload/WebsiteHomeFeature/5/image.jpeg', 'Клубная Жизнь', '&lt;div&gt;\r\n\r\nРайон расположения жилого комплекса&amp;nbsp; Аркадия является культовым местом ночного отдыха и развлечения – буквально в 5-10 минутах ходьбы от комплекса находятся такие места сосредоточения клубной жизни страны&lt;br&gt;&lt;/div&gt;', 0),
(6, '/upload/WebsiteHomeFeature/6/image.jpeg', 'Удобная транспортная развязка', '&lt;p&gt;\r\n\r\nЖК&amp;nbsp; расположена  на берегу Черного моря в районе Аркадии и имеет удобную транспортную развязку, позволяющую даже в час Пик быстро и без проблем доехать в течение десяти минут до центра города или выехать на автострады Одесской обл\r\n\r\n&lt;br&gt;&lt;/p&gt;', 0);
