INSERT INTO `website_service` (`id`, `image`, `title`, `description`, `sort`) VALUES
(1, '/upload/WebsiteService/1/image.jpg', ' Уборка комплекса (парадных) и территории, вывоз мусора', '<p>\r\n\r\nУправляющая компания осуществляет весь комплекс работ по уборке комплекса, придомовой территории и набережной . В зимнее время года территория жилого комплекса своевременно очищается от снега и льда, пешеходные пандусы, дорожки и проезжая часть обрабатываются анти скользящими составами. Специалисты управляющей компании осуществляют регулярный уход за зелеными насаждениям.\r\n\r\n<br></p>', 0),
(2, '/upload/WebsiteService/2/image.jpg', 'Обслуживание паркинга', '<p>\r\n\r\nЖилой комплекс&nbsp; имеет собственный четырехуровневый надземный паркинг, обслуживание которого осуществляет управляющая компания.<br>Обслуживание паркинга включает в себя следующие работы и услуги: Уборка территории, &nbsp;Поддержание функционирования инженерных сетей паркинга, &nbsp;Обслуживание системы выезда-въезда в паркинг,  Обеспечение функционирования пропускного режима для въезда на территорию паркинга, &nbsp;Охрана и обеспечение безопасности жильцов и автомобильного транспорта.\r\n\r\n<br></p>', 0),
(3, '/upload/WebsiteService/3/image.jpg', 'Обслуживание лифтов', '<p>\r\n\r\nЛифтовое хозяйство жилого комплекса представлена современными высокоскоростными пассажирскими и грузопассажирскими лифтовыми системами от мирового производителя.<br>Обслуживание лифтового хозяйства включает в себя: &nbsp;Уборку в кабинах лифтов и обеспечение сохранности лифтов, выполняемые штатными сотрудниками компании, &nbsp;Техническое обслуживание лифтов, выполняемое силами подрядных организаций. \r\n\r\n<br></p>', 0),
(4, '/upload/WebsiteService/4/image.jpg', 'Охрана жилого комплекса', '<p>\r\n\r\nОхрана жилого комплекса осуществляется штатными специалистами управляющей компании. Охрана жилого комплекса охватывает апартаменты жильцов, придомовую территорию и надземный паркинг с автотранспортом. Охрана жилого комплекса осуществляется с использованием современной системы контроля доступа и видеонаблюдения за территорией. Попасть на территорию комплекса жильцы могут только при наличие электронного ключа, а гости – через систему заявок от жильцов дома на посещение.\r\n\r\n<br></p>', 0);
